[{"sha":"dc64eca3aac8d3e49523a4b3852081b82bd6de7c","author":{"name":"Junichi Yamamoto","email":"b167b8eb530b93e72c6c0e9a10d8503b2e9a4f7e@apache.org"},"message":"[NETBEANS-4443] PHP 8.0 Support: Constructor Property Promotion (Part 8)

https://issues.apache.org/jira/browse/NETBEANS-4443

- https://wiki.php.net/rfc/constructor_promotion
- Handle incorrect declaration of Constructor Property Promotion

```php
<?php
class WithCallable {
    public function __construct(
            public callable $incorrect,
    ) {
    }
}

class WithVariadic {
    public function __construct(public int ...$incorrect1) {}
}

abstract class AbstractConstructor1 {
    abstract public function __construct(
            public int $incorrect1,
            private ?string $incorrect2
    );
}

interface AbstractConstructor2 {
    public function __construct(public int $incorrect);
}

// Other than a construcotr
class OtherThanConstructor {
    public function otherThanConstructor(private $incorrect){}
}

function otherThanConstuctor(private int $incorrect) {}

$labmda = function (
        private int $incorrect,
) {
};

$fn = fn(private $incorrect) => "";
